#include <iostream>

#include <map>

using namespace std;

class Solution {
public:
    static int lengthOfLongestSubstring(string s) {

        int present[256];

        for(int i = 0; i < 256; ++i)
        {
            present[i] = 0;
        }

        int maxLength = 0, currentLength = 0;

        unsigned long length = s.length();

        for(int index = 0; index < length; ++index)
        {
            if(!present[s[index]])
            {
                present[s[index]] = 1;

                ++currentLength;

                continue;
            }
            else
            {
                index = index - currentLength + 1;

                if(currentLength > maxLength)
                {
                    maxLength = currentLength;
                }

                currentLength = 0;

                for(int i = 0; i < 256; ++i)
                {
                    present[i] = 0;
                }

                present[s[index]] = 1;

                ++currentLength;
            }
        }

        if(currentLength > maxLength)
        {
            maxLength = currentLength;
        }

        return maxLength;
    }
};

